queries_executed.query:
anomaly.*.{
  anomaly_id: anomaly_id,
  name: name,
  theory_id: theory_id,
  violated_assumptions: violated_assumptions.*.{
    assumption_id: assumption_id,
    violation_description: violation_description
  },
  violated_claims: violated_claims
}

theory.*.{
  theory_id: theory_id,
  name: name,
  assumptions: assumptions.*.{
    assumption_id: assumption_id,
    statement: statement
  },
  claims: claims.*.{
    claim_id: claim_id,
    statement: statement
  }
}

theory['general-relativity'].claims.*.{
  claim_id: claim_id,
  statement: statement,
  status: status
}

theory.* | [?theory_id == 'general-relativity'] | [0].claims.*.{
  claim_id: claim_id,
  statement: statement,
  status: status
}
